// Função para converter respostas_json para formato legível
function formatarRespostas(respostasJson) {
  let respostas;

  // Se já é um objeto, usa diretamente. Se é string, faz parse
  if (typeof respostasJson === 'string') {
    try {
      respostas = JSON.parse(respostasJson);
    } catch (e) {
      console.log('Erro ao fazer parse do JSON:', e);
      return {
        modeloNegocio: '',
        tamSamSom: '',
        pesquisaQualitativa: '',
        concorrentes: '',
        persona: '',
        pitch: '',
        programasAnteriores: ''
      };
    }
  } else {
    respostas = respostasJson;
  }

  // Função auxiliar para converter valores booleanos
  const formatarBoolean = (valor) => {
    if (valor === true) return 'Sim';
    if (valor === false) return 'Não';
    if (valor === '') return 'Não Informado';
    return valor || 'Não Informado';
  };

  // Função para formatar pesquisa e concorrentes
  const formatarPesquisa = (valor) => {
    switch (valor) {
      case 'nao_realizei': return 'Não Realizei';
      case 'informal': return 'Informal';
      case 'dados_organizados': return 'Dados Organizados';
      default: return valor || 'Não Informado';
    }
  };

  return {
    modeloNegocio: formatarBoolean(respostas.modeloNegocio),
    tamSamSom: formatarBoolean(respostas.tamSamSom),
    pesquisaQualitativa: formatarPesquisa(respostas.pesquisaQualitativa),
    concorrentes: formatarPesquisa(respostas.concorrentes),
    persona: formatarBoolean(respostas.persona),
    pitch: formatarBoolean(respostas.pitch),
    programasAnteriores: formatarBoolean(respostas.programasAnteriores)
  };
}

// Função para formatar campos diretos do Supabase
function formatarCamposDirectos(dados) {
  // Função para normalizar respostas diretas
  const normalizarResposta = (valor) => {
    if (valor === null || valor === undefined || valor === '') return 'Não Informado';

    const valorStr = String(valor).toLowerCase().trim();

    // Para campos boolean/sim/não
    if (valorStr === 'sim' || valorStr === 'true') return 'Sim';
    if (valorStr === 'não' || valorStr === 'nao' || valorStr === 'false') return 'Não';

    // Para pesquisa qualitativa
    if (valorStr.includes('informalmente sem dados') || valorStr.includes('informal')) return 'Informal';
    if (valorStr.includes('dados organizados')) return 'Dados Organizados';
    if (valorStr.includes('ainda não realizei') || valorStr.includes('não realizei')) return 'Não Realizei';

    // Para mapeamento concorrentes
    if (valorStr.includes('fiz informalmente') || valorStr.includes('informal')) return 'Informal';

    return String(valor).trim() || 'Não Informado';
  };

  return {
    modeloNegocio: normalizarResposta(dados['Plano de negócios']),
    tamSamSom: normalizarResposta(dados['TamSamSom']),
    pesquisaQualitativa: normalizarResposta(dados['Pesquisa qualitativa:']),
    concorrentes: normalizarResposta(dados['Mapeamento concorrentes']),
    persona: normalizarResposta(dados['Persona']),
    pitch: normalizarResposta(dados['Pitch']),
    programasAnteriores: normalizarResposta(dados['Programas'])
  };
}

// Função para formatar resultado
function formatarResultado(resultado) {
  switch (resultado) {
    case 'Trilha Inicial': return 'Trilha Inicial';
    case 'Trilha Avançada': return 'Trilha Avançada';
    case 'Aprovado para Incubação': return 'Aprovado para Incubação';
    case 'aprovado_incubacao': return 'Aprovado para Incubação';
    case 'trilha_inicial': return 'Trilha Inicial';
    case 'trilha_avancada': return 'Trilha Avançada';
    default: return resultado || 'Não Definido';
  }
}

// Função para formatar status
function formatarStatus(status) {
  switch (status) {
    case 'trilha_inicial': return 'Trilha Inicial';
    case 'trilha_avancada': return 'Trilha Avançada';
    case 'aprovado_incubacao': return 'Aprovado Incubação';
    default: return status || 'Não Definido';
  }
}

// Função para formatar data
function formatarData(dataIso) {
  if (!dataIso) return 'Não Informado';

  try {
    const data = new Date(dataIso);
    return data.toLocaleDateString('pt-BR') + ' ' + data.toLocaleTimeString('pt-BR', { 
      hour: '2-digit', 
      minute: '2-digit' 
    });
  } catch (e) {
    return 'Data Inválida';
  }
}

// Processar os dados do Supabase
const dadosFormatados = [];

for (const item of $input.all()) {
  const dados = item.json;

  // Primeiro tenta usar os campos diretos do Supabase
  let respostasFormatadas = formatarCamposDirectos(dados);

  // Se os campos diretos estão vazios/null, usa o respostas_json como fallback
  const temCamposDirectos = Object.values(respostasFormatadas).some(valor => valor !== 'Não Informado');

  if (!temCamposDirectos && dados.respostas_json) {
    respostasFormatadas = formatarRespostas(dados.respostas_json);
  }

  dadosFormatados.push({
    Nome: dados.nome || 'Não Informado',
    Pontuacao: dados.pontuacao || 0,
    Projeto: dados.projeto || 'Não Informado',
    Email: dados.email || 'Não Informado',
    WhatsApp: dados.whatsapp || 'Não Informado',
    Resultado: formatarResultado(dados.resultado),
    Status: formatarStatus(dados.status),
    'Data Qualificacao': formatarData(dados.data_qualificacao),
    'Modelo Negocio': respostasFormatadas.modeloNegocio,
    'TAM/SAM/SOM': respostasFormatadas.tamSamSom,
    'Pesquisa Qualitativa': respostasFormatadas.pesquisaQualitativa,
    'Concorrentes': respostasFormatadas.concorrentes,
    'Persona': respostasFormatadas.persona,
    'Pitch': respostasFormatadas.pitch,
    'Programas Anteriores': respostasFormatadas.programasAnteriores
  });
}

return dadosFormatados.map(item => ({ json: item }));

